function handleTweets(tweets) {
	
	var x = tweets.length;
	var n = 0;
	var element = document.getElementById('tweet');
	var html = '<ul>';
	
	while(n < x) {
		html += '<li>' + tweets[n] + '</li>';
		n++;
	}
	
	html += '</ul>';
	element.innerHTML = html;
	
	// TWITTER SLIDER //
			
	$("#tweet ul").owlCarousel({
		singleItem: true,
		slideSpeed: 200,
		autoPlay: true,
		stopOnHover: true,
		navigation: true,
		navigationText: false,
		pagination: true,
		paginationNumbers: false,
		mouseDrag: false,
		touchDrag: true,
		transitionStyle: "fade"
	});
}
